(17, 43, 1112, 1, 1, 5, 3, 3, 5, 3, 5, 5, 7, 1, 0, 0, 75.00, 45.00, 15.00, 50.00, 60.00, 75.00, 50.00, 35.00, 5, 0, 0, 'Roadmap tidak lengkap, tidak menyebutkan jurnal scopus, dan tidak ada TKT.  Riset ini dapat diterima dengan maksimum Rp. 29.000.000 (biaya publikasi, transportasi dan akomodasi serta ATK masih tinggi)', '2020-03-30 13:22:12', '2020-03-30 13:22:12'),
